INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0113', 0, 'adon', 'lord', 'Adon - lord or master as opposed to Adonai{H0136}, LordOfMine');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0136', 0, 'Adonai', 'LordOfMine', 'Adonai - My Lord\r\n\r\nmy Lord\r\nAn emphatic form of \'adon{H0113}\'; the Lord (used as a proper name of God only) -- (my) Lord.\r\n\r\nsee HEBREW \'adon{113}\'');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0403', 0, 'aken', 'surely', 'Surely, truly, sometimes emphasising a contrast: however');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0410', 0, 'El', 'God', 'Singular God as opposed to the plural Elohim{H0430}');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0426', 0, 'Elah', 'God', 'Elah - singular of Elohim{H0430} God or god');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0430', 0, 'Elohim', 'God', 'Elohim - the plural of eloah, literally \'gods\' often used for the true God');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0433', 0, 'Eloah', 'God', 'Eloah - the singular of elohim{H430}, literally \'god\'.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0543', 1, 'Amen', 'This-is-Truth', 'Amen. Mark The Words. So be it. Emphatic YES! So let it be written, so let it be done. Truly. With all emphasis. Listen! Absolutely! If you get *one* thing... The Hebrew root -m-n also conveys meanings of firmness, reliability, and faithfulness.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H0776', 0, 'erets', 'ground', '\"earth\", land, ground. In Hebrew this word never means earth as in soil, but land, ground etc.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H1166', 0, 'baal', 'Marry/Own', 'Marry/Own');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H1167', 0, 'baal', 'Husband/Master/Owner', 'Husband/Master/Owner');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H1376', 0, 'gevir', 'ruler', 'ruler, master. Not especially interesting perhaps in itself; were it not for the fact it is only used twice - in the story of Jacob as opposed to his brother, Esau - never of God or anyone else.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H1814', 0, 'dalaq', 'hotly-pursue', 'Hotly-pursue, burn, ignite, inflame');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H2657', 1, 'Hepzibah', 'MyDelightIsInHer', 'Hepzibah = \"my delight is in her\"\r\n1) the queen of King Hezekiah and mother of Manasseh\r\n2) a name for Jesusalem (fig.)');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H3050', 1, 'Yah', 'EverOne', 'Yah - An abbreviation of the proper name for God, Yahweh{H3068}');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H3068', 1, 'Yahweh', 'ForeverOne', 'Yud-Heh-Vav-Heh (Yahweh/Jehovah) - The proper name for God. In Jewish circles never spoken; normally spoken as Adonai{H136} or HaShem');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H3742', 0, 'keruv', 'throne-angel', 'Cherubs are not cute baby angels but mighty angelic beings! The full meaning is unknown but my take, ThroneAngel is based on their presence with ForeverOne himself. Other suggestions are Blessers, Mighty Ones, Approachers, or Internal Ones.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H4756', 0, 'mare', 'lord', 'Master;lord. Only occurs in Daniel');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H4785', 1, 'Marah', 'BitterPlace', 'The word means Bitter, rather than BitterPlace but is used only for the spring with bitter water which was 3 days travel from the crossing place of the Red Sea in the peninsula of Sinai.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H4886', 0, 'mashach', 'anoint', 'to anoint (with oil)');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H4899', 0, 'mashiach', 'anointed', 'anointed (Messiah)');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H5375', 0, 'nasa', 'carry', 'lift, carry, bear, hold, take');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H5542', 1, 'selah', 'SolidRock', 'The meaning of this word is unclear. It is used in psalms as some form of exclamation or perhaps a musical instruction. I have chosen SolidRock as a non-transliterative placeholder.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H5633', 0, 'ceren', 'Lord;tyrant', 'Lord/Tyrant');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H6212', 0, 'esev', 'plant', 'plant, vegetation');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H7291', 0, 'radaph', 'pursue', 'Pursue, follow closely, chase');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H7307', 0, 'ruach', 'spirit/breath/breeze', 'ruach - wind, breath, spirit.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H7706', 0, 'Shaddai', 'Almighty', 'Almighty - usually God almighty.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H7723', 0, 'shav', 'emptily/unworthily', 'emptiness, vanity, falsehood 1a) emptiness, nothingness, vanity 1b) emptiness of speech, lying 1c) worthlessness (of conduct)');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H8064', 0, 'shamayim', 'sky', '\"heavens\", sky, skies. The Hebrew is plural and usually conveys the physical sky above our heads.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H8314', 1, 'seraphim', 'BurningOnes', 'Fiery; Burning; burning ones');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('H8392', 0, 'tevah', 'vessel', 'The ark - the vessel which Noah built; the basket vessel in which Moses was placed.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0025', 0, 'agapeo', 'selflessly-love', 'Determined, active loving that has more to do with willing good for others than any emotional feeling. The verb of {G0026}');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0026', 0, 'agape', 'selfelss-love', 'The determined active love that has more to do with willing good for others than any emotional feeling. The noun of {G0025}');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0027', 0, 'agapetos', 'dear, dear-ones', 'Beloved, recipients of the greatest love{G0026}, loved.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0264', 0, 'hamartano', 'fall-short', 'Falling short, miss, sin, shortcoming.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0265', 0, 'hamartema', 'shortcoming', 'Falling short, miss, sin, shortcoming.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0266', 0, 'hamartia', 'shortcomings', 'Falling short, miss, sin, shortcomings.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0268', 0, 'hamartolos', 'shortcomer', 'One who falls short, misses, a sinner, shortcomer.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0281', 1, 'Amen', 'This-is-Truth', 'Straight transliteration from the Hebrew, Amen. Mark The Words. So be it. Emphatic YES! So let it be written, so let it be done. Truly. With all emphasis. Listen! Absolutely! If you get *one* thing... The Hebrew root -m-n also conveys meanings of firmness, reliability, and faithfulness.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0435', 0, 'aner', 'man', 'An adult male human.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0444', 0, 'anthropos', 'people', 'Often translated \'men\' but is not gender specific - so humans, people, humankind.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0652', 0, 'apostolos', 'ambassador', 'Apostle is merely a transliteration of the Greek, which means \'sent out one\', \'set apart one\'. I believe ambassador is the most meaningful modern English equivalent.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G0862', 0, 'afthartos', 'permanent', 'Un-temporary; imperishable; immortal; permanent');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G1203', 0, 'Despotes', 'Master', 'Master - the English \'despot\' comes from this word.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G1378', 0, 'dogma', 'dogma', 'One of 3 main words for law in the New Testament, dogma, entole and nomos. This one is where the English \'dogmatic\' comes from.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G1393', 1, 'Dorcas', 'Gazelle', 'Dorcas is the Greek translation of the Aramaic Tabitha, which means gazelle in both languages. In the New Testament, Dorcas is the Greek name given to Tabitha, a woman known for her good works and acts of charity in Joppa.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G1785', 0, 'entole', 'law', 'One of 3 main words for law in the New Testament, dogma, entole and nomos.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G1459', 0, 'Enkataleipo', 'Abandon', 'Abandon or Forsake ');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2209', 0, 'zemia', 'damage', '\'damage/loss\' loss, damage');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2315', 0, 'Theopneustos', 'Godbreathed', 'Literally the breath/wind/spirit-making of God. God breathed as one word. Only occurs once in 2 Timothy 3:16');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2519', 0, 'kathegetes', 'teacher', 'teacher');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2634', 0, 'katakurieuo', 'master', 'master - \'against-lord\'');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2635', 0, 'katalaleo', 'slander', 'Literally \'against-speak\'. To slander, to speak against, to incriminate.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2823', 0, 'klibanos', 'fire-oven', 'This was an earthenware pot for baking bread. It was broader at the bottom than at the top, and with a fire lit inside, the dough was baked by being spread on the outside.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2960', 0, 'Kuriakos', 'Master', 'Pertaining to the Lord');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2961', 0, 'kurieuo', 'dominate', 'master, lord, dominate');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G2962', 0, 'Kurios', 'Lord', 'Lord. Notably this may stand for Yahweh{H3068} as the Jewish tradition to never say Yahweh{H3068}, and say Adonai{H0136} (Lord) instead, was in place long before the New Testament (about 300 BC)');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3106', 0, 'makarizo', 'happy', 'Often translated Blessed, a bit old fashioned now, it is an emphatic form of happy.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3107', 0, 'makarios', 'happier', 'Often translated Blessed, a bit old fashioned now, it is an emphatic form of happy.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3126', 0, 'mammon', 'your-savings', 'TrustTreasure - what you rely on, your-savings, investment.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3323', 0, 'Messias', 'Messiah', 'Greek transliteration of the Hebrew {H4899}, Mashiach, Messiah. Anointed; Messiah (in Jewish tradition not THE messiah). Only found in John 1 and 4. Equivalent to {G5547}');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3339', 0, 'metamorfoo', 'transformed', 'This is the Greek root word from which we get the English word Metamorphose.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3551', 0, 'nomos', 'law', 'One of 3 main words for law in the New Testament, dogma, entole and nomos. This one is frequently used for Torah, Mosaic Law.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3841', 0, 'Pantokrator', 'Almighty', 'Almighty - only applied (obviously!) to God. Equivalent to {H7706}.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3985', 0, 'peirazo', 'temptation', 'Most often translated temptation. Testing, trial, trap.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G3986', 0, 'peirasmos', 'testing', 'Often translated temptation. Testing, trial, trap.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G4550', 0, 'sapros', 'rotten', 'This has a strongly negative meaning- not just rotten but corrupting or causing disease or being diseased.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G4657', 0, 'skubalon', 'filth', 'Disgusting rubbish; rotten; filth; refuse; dung. This can refer to any of a number of rotten, decaying things that must be disposed of. It is only used in Philippians 3:8.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G4995', 0, 'sofronismos', 'soundness-of-mind', 'This is subtle and can mean soundness-of-mind, self-discipline, prudence, wisdom. It is only used in 2 timothy 1:7.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G5349', 0, 'fthartos', 'temporary', 'Temporary or mortal; not lasting, perishable, impermanent.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G5509', 0, 'chiton', 'tunic', 'Strictly a tunic but often the main or only garment worn, either by men or women. Robe; clothing; undergarment.');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G5546', 0, 'kristianos', 'christian', 'Christian; \'one belonging to Christ\'; Messianic believer;');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G5547', 0, 'Kristos', 'AnointedOne', 'AnointedOne; Christ, anointed one, Messiah');
INSERT INTO strongs (strongsNumber, strongsIsName, strongsOriginal, strongsEnglish, strongsDefinition) VALUES('G5580', 0, 'pseudokristos', 'false-anointed-ones', 'Christ and Messiah both mean anointed one. Ungodly imitators of Jesus Christ will come who make bold claims but are not Him.');
